rrecta:\",\"inputLabel\":\"Hueco @num de @total\",\"inputHasTipLabel\":\"Pista disponible\",\"tipLabel\":\"Pista\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":false,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"Has conseguido :num de un total de :total puntos\",\"a11yCheck\":\"Comprobar las respuestas. Las respuestas serán marcadas como correcta, incorrectas o sin contestar.\",\"a11yShowSolution\":\"Mostrar la solución. La tarea se marcará con su solución correcta.\",\"a11yRetry\":\"Vuelve a intentar la tarea. Borra todas tus respuestas y empieza de nuevo.\",\"a11yCheckingModeHeader\":\"Modo de Comprobación\",\"confirmCheck\":{\"header\":\"¿ Terminar ?\",\"body\":\"¿Está seguro que desea terminar ?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Terminar\"},\"confirmRetry\":{\"header\":\"¿Intentar de nuevo?\",\"body\":\"¿Seguro que quieres volver a intentarlo?\",\"cancelLabel\":\"Cancelar\",\"confirmLabel\":\"Confirmar\"},\"questions\":[\"<p>Entrando al cuarto más procurado de la casa conseguimos ver un objeto grande y *blanco* en el cual es posible llenar con mucha *agua* y limpiar todo el *cuerpo*. Este objeto lo llamamos una *bañera*.</p>\\n\\n<p>En el fondo del cuarto vemos unas *ventanas*&nbsp;que nos dejan ver la *ciduad* entera. Estas tienen unas *cortinas* transparentes y altas en cada lado. Al frente de estas encontramos una *silla*&nbsp;donde nos podemos *sentar* y descansar.&nbsp;</p>\\n\\n<p>En el lado *izquierdo* del cuarto,&nbsp; opuesto al objeto grande y *blanco*, vemos dos *lavamanos* y por debajo de estos, en el piso,&nbsp;seis *toallas* grandes que usamos para secar las *manos*, cara y cuerpo.&nbsp;</p>\\n\\n<p>Cuando nos queremos lavar los *dientes*, podemos abrir una de las ocho *gavetas* y sacar la pasta de *dientes*. En estas podemos guardar por ejemplo el *cepillo* para peinar el *cabello*, jabones, perfumes y muchas otras cosas.&nbsp;</p>\\n\"]},\"metadata\":{\"embedTypes\":[\"iframe\"],\"language\":\"en\",\"defaultLanguage\":\"es\",\"license\":\"U\",\"extraTitle\":\"Descubrir Nuestra Casa (Fill in the Blanks)\",\"title\":\"Descubrir Nuestra Casa (Fill in the Blanks)\",\"mainLibrary\":\"H5P.Blanks\",\"preloadedDependencies\":[{\"machineName\":\"H5P.Image\",\"majorVersion\":1,\"minorVersion\":1},{\"machineName\":\"FontAwesome\",\"majorVersion\":4,\"minorVersion\":5},{\"machineName\":\"H5P.Question\",\"majorVersion\":1,\"minorVersion\":5},{\"machineName\":\"H5P.JoubelUI\",\"majorVersion\":1,\"minorVersion\":3},{\"machineName\":\"H5P.Transition\",\"majorVersion\":1,\"minorVersion\":0},{\"machineName\":\"H5P.FontIcons\",\"majorVersion\":1,\"minorVersion\":0},{\"machineName\":\"H5P.TextUtilities\",\"majorVersion\":1,\"minorVersion\":3},{\"machineName\":\"H5P.Blanks\",\"majorVersion\":1,\"minorVersion\":14}],\"authors\":[],\"changes\":[],\"contentType\":\"Preencher as lacunas (Fill in the Blanks)\"},\"subContentId\":\"d362c169-872a-4423-9f81-132556ea539d\"}],\"disableBackwardsNavigation\":false,\"randomQuestions\":false,\"endGame\":{\"showResultPage\":true,\"showSolutionButton\":true,\"showRetryButton\":true,\"noResultMessage\":\"Terminado\",\"message\":\"O seu resultado:\",\"scoreBarLabel\":\"Obteve @finals de @totals pontos\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"solutionButtonText\":\"Mostrar solução\",\"retryButtonText\":\"Repetir\",\"finishButtonText\":\"Terminar\",\"submitButtonText\":\"Enviar\",\"showAnimations\":false,\"skippable\":false,\"skipButtonText\":\"Ignorar vídeo\"},\"override\":{\"checkButton\":true},\"texts\":{\"prevButton\":\"Pergunta anterior\",\"nextButton\":\"Próxima pergunta\",\"finishButton\":\"Terminar\",\"submitButton\":\"Enviar\",\"textualProgress\":\"Questão: @current de @total questões\",\"jumpToQuestion\":\"Questão %d de %total\",\"questionLabel\":\"Questão\"
